import React from "react";
import "./LandingPage.css";
import LocalTaxiIcon from "@mui/icons-material/LocalTaxi";
import EmojiPeopleIcon from "@mui/icons-material/EmojiPeople";
import HailIcon from "@mui/icons-material/Hail";
// import Nav from "../NavBar/Nav";
// import Form from "./Form";
const LandingPage = () => {
  return (
    <>
      <div className="bgg">
        <div className="landingPageHeading">
          <h1>TERMINAL</h1>
          <div className="headingIcons">
            <i>
              <HailIcon
                fontSize="large"
                style={{
                  marginTop: 15,
                  marginLeft: 15,
                  marginRight: -10,
                  fontSize: 50,
                  color: "aliceblue",
                }}
              />
            </i>
            <i>
              <LocalTaxiIcon
                fontSize="large"
                style={{
                  marginTop: 15,
                  marginLeft: 10,
                  fontSize: 70,
                  color: "aliceblue",
                }}
              />
            </i>
            <i>
              <EmojiPeopleIcon
                fontSize="large"
                style={{
                  marginTop: 15,
                  marginLeft: -10,
                  fontSize: 50,
                  color: "aliceblue",
                }}
              />
            </i>
          </div>
        </div>
        <div className="intoText">
          <div className="margins">
            <h1>India's First Cab Sharing Platform</h1>
            <p>Divided by Apps United By Us</p>
          </div>
          <div className="btns">
            <button className="btn1">Book Ride</button>
            <button className="btn2">Log In</button>
          </div>
        </div>
      </div>
      <div className="bigtext">
        <h1>Why You Should Choose Us</h1>
      </div>
    </>
  );
};

export default LandingPage;
